    return (
        <div className="UserJobs">
           <div className="container-fluid">
                <div className="row justify-content-between">
                    <div className="col-md-8 col-sm-12 " align="center" style={{background:"blue"}}>
                        <h2>jobs</h2>
                    </div>
                </div>
           </div>
        </div>
    );
}
export default JobList;
